t de procéder au recouvrement, le pouvoir adjudicateur doit notifier formellement au contractant son intention de recouvrer le montant concerné, en précisant le montant dû et les motifs du recouvrement et en invitant le contractant à faire part de ses observations dans un délai de 30 jours à compter de la réception de la notification.

